(function() {
  window.sp.classes.FilterWidget = (function() {
    function FilterWidget(dataPath, callback) {
      var self;
      this.dataPath = dataPath;
      this.callback = callback;
      self = this;
      this.$form = $("#filter-widget");
      this.$buttons = this.$form.find('.button-group .button');
      this.$submit = this.$form.find('button:submit');
      this.start = this.datePicker(this.$form.find('#filter_widget_start'));
      this.finish = this.datePicker(this.$form.find('#filter_widget_finish'));
      this.$buttons.on("click", function(event) {
        event.preventDefault();
        return self.updateDates($(this));
      });
      this.$form.on("submit", function(event) {
        event.preventDefault();
        return self.updateWidgets();
      });
      this.updateWidgets();
    }

    FilterWidget.prototype.datePicker = function($element) {
      $element.kendoDatePicker({
        format: "yyyy-MM-dd"
      });
      return $element.data("kendoDatePicker");
    };

    FilterWidget.prototype.parseDate = function(dateString) {
      return kendo.parseDate(dateString, "yyyy-MM-dd");
    };

    FilterWidget.prototype.updateDates = function($current) {
      this.$buttons.removeClass("info");
      $current.addClass("info");
      this.start.value(this.parseDate($current.data("start")));
      this.finish.value(this.parseDate($current.data("finish")));
      this.$form.submit();
      return this;
    };

    FilterWidget.prototype.dataParams = function() {
      return {
        filter_widget: {
          start: kendo.toString(this.start.value(), "u"),
          finish: kendo.toString(this.finish.value(), "u")
        }
      };
    };

    FilterWidget.prototype.updateWidgets = function() {
      $.get(this.dataPath, this.dataParams()).success((function(_this) {
        return function(data) {
          return _this.callback(data);
        };
      })(this));
      this.$submit.removeAttr('disabled');
      return this;
    };

    return FilterWidget;

  })();

}).call(this);
